def main():
    directory = '../input/'
    train = pd.read_csv(directory+'train.csv')
    test = pd.read_csv(directory+'test.csv')
    features = train.columns[1:]
    trainlabels = train.label.values
    train.drop('label', inplace=True, axis=1)
    alldata = pd.concat([train[features], test[features]])
    ss = StandardScaler()
    ss.fit(alldata)
    train[features] = ss.transform(train[features])
    test[features] = ss.transform(test[features])
    train['target'] = trainlabels
    gptrain = GP(train)
    gptest = GP(test)
    mloss = pd.DataFrame()
    for i in range(10):
        mloss["i" + str(i)] = \
            Outputs(gptrain[gptrain.columns[250*i:(250)*(i+1)]].sum(axis=1))
        print(log_loss(train.target == i, mloss["i" + str(i)]))
    print(log_loss(train.target, mloss.values))
    print(accuracy_score(train.target, mloss.values.argmax(axis=1)))
    mloss = pd.DataFrame()
    for i in range(10):
        mloss["i" + str(i)] = \
            Outputs(gptest[gptest.columns[250*i:(250)*(i+1)]].sum(axis=1))
    preds = mloss.values.argmax(axis=1)
    submission = pd.DataFrame({'ImageId': range(test.shape[0]),
                               'Label': preds})
    submission.ImageId += 1
    submission.to_csv('gpsubmission.csv', index=False)


if __name__ == "__main__":
    main()
